description:
American Weed finds Colorado medical marijuana businesses under scrutiny and facing mounting pressures from local residents. Medical cannabis entrepreneur and Fort Collins dispensary owner Josh Stanley works aggressively to counter such pressure with radio ads and fundraisers. As the oldest of 11 kids, Josh relies heavily on several of his brothers to work at the grove and keep his business supplied in medical marijuana. Meanwhile, Sgt. Jim Gerhardt and fellow officers on the North Metro Task Force continue to find illegal grows by residents claiming to be growing medical marijuana. Is the pendulum swinging back to curb the 10-year proliferation of medical marijuana in Colorado? Find out what happens when a small Colorado town must decide whether or not to legalize a budding industry. 
